public class Test0412_1 {

    public static void main(String[] args) {
        // 常量字符串最大支持65534位，因为虚拟机定义 占用无符号2字节(16位)。即最大表示2^16-1 = 65535 但是jvm 需要一位表示结束指令。所以最大 65535-1
        // 常量字符串超过这个位数，会编译报错
        String str1 = "";
        System.out.println(str1.length());

        // 但是通过运行时拼接或者赋值。则最大为2^32-1
        String str2 = "vvv";
        String str = str1 + str2;
        System.out.println(str.length()); // 65537
    }

}
